import React, { useState, useRef, useEffect } from 'react';

function Calendar({ employees, onAddEmployee, onEditEmployee }) {
  // Modal and dropdown state
  const [showAddEmployeeModal, setShowAddEmployeeModal] = useState(false);
  const [showTeamModal, setShowTeamModal] = useState(false);
  const [showEditEmployeeModal, setShowEditEmployeeModal] = useState(false);
  const [showLocationDropdown, setShowLocationDropdown] = useState(false);
  const [selectedEmployee, setSelectedEmployee] = useState(null);

  // Create refs for the modals and dropdowns
  const locationDropdownRef = useRef(null);
  const locationButtonRef = useRef(null);
  const addEmployeeModalRef = useRef(null);
  const teamModalRef = useRef(null);
  const editEmployeeModalRef = useRef(null);

  // Drag and drop handlers
  const handleDragStart = (e) => {
    e.dataTransfer.setData("text/plain", e.currentTarget.dataset.id);
    e.currentTarget.classList.add("dragging");
  };

  const handleDragEnd = (e) => {
    e.currentTarget.classList.remove("dragging");
  };

  const handleDragOver = (e) => {
    e.preventDefault();
    e.currentTarget.classList.add("active");
  };

  const handleDragLeave = (e) => {
    e.currentTarget.classList.remove("active");
  };

  const handleDrop = (e) => {
    e.preventDefault();
    e.currentTarget.classList.remove("active");
    const draggable = document.querySelector(".dragging");
    if (draggable) {
      e.currentTarget.appendChild(draggable);
    }
  };

  // Modal and dropdown toggle functions
  const toggleLocationDropdown = () => setShowLocationDropdown(!showLocationDropdown);
  const openAddEmployeeModal = () => {
    setShowAddEmployeeModal(true);
    if (showTeamModal) closeTeamModal();
  };
  const closeAddEmployeeModal = () => setShowAddEmployeeModal(false);
  const openTeamModal = () => setShowTeamModal(true);
  const closeTeamModal = () => setShowTeamModal(false);
  const openEditEmployeeModal = (employee) => {
    setSelectedEmployee(employee);
    setShowEditEmployeeModal(true);
    if (showTeamModal) closeTeamModal();
  };
  const closeEditEmployeeModal = () => {
    setSelectedEmployee(null);
    setShowEditEmployeeModal(false);
  };

  // Handle click outside for location dropdown
  useEffect(() => {
    function handleClickOutside(event) {
      // Handle location dropdown
      if (
        locationDropdownRef.current && 
        !locationDropdownRef.current.contains(event.target) &&
        locationButtonRef.current && 
        !locationButtonRef.current.contains(event.target)
      ) {
        setShowLocationDropdown(false);
      }

      // Handle add employee modal
      if (
        showAddEmployeeModal &&
        addEmployeeModalRef.current && 
        !addEmployeeModalRef.current.contains(event.target)
      ) {
        closeAddEmployeeModal();
      }

      // Handle team modal
      if (
        showTeamModal &&
        teamModalRef.current && 
        !teamModalRef.current.contains(event.target)
      ) {
        closeTeamModal();
      }

      // Handle edit employee modal
      if (
        showEditEmployeeModal &&
        editEmployeeModalRef.current && 
        !editEmployeeModalRef.current.contains(event.target)
      ) {
        closeEditEmployeeModal();
      }
    }

    document.addEventListener("mousedown", handleClickOutside);
    return () => {
      document.removeEventListener("mousedown", handleClickOutside);
    };
  }, [showAddEmployeeModal, showTeamModal, showEditEmployeeModal, showLocationDropdown]);

  return (
    <div className="bg-[#1a1d20] text-gray-200 flex-1 flex flex-col overflow-auto h-full">
      {/* Header Section */}
      <header className="bg-[#16181a] py-4 px-6 shadow-lg flex-shrink-0">
        <div className="container mx-auto flex flex-col md:flex-row justify-between items-center">
          <div className="flex items-center mb-4 md:mb-0">
            <div className="w-10 h-10 bg-gray-700 text-white rounded-full flex items-center justify-center font-bold mr-3">
              R
            </div>
            <h1 className="text-xl font-semibold text-white">Restaurant Name</h1>
          </div>
          <div className="flex flex-wrap gap-3">
            <div className="relative">
              <button 
                ref={locationButtonRef}
                onClick={toggleLocationDropdown}
                className="flex items-center bg-[#1e2024] hover:bg-[#23252a] px-4 py-2 rounded-lg transition"
              >
                <i className="fas fa-store mr-2 text-blue-400"></i>
                <span>Downtown Location</span>
                <i className="fas fa-chevron-down ml-2 text-sm"></i>
              </button>
              {showLocationDropdown && (
                <div 
                  ref={locationDropdownRef}
                  className="absolute z-10 mt-2 w-48 bg-[#1e2024] rounded-lg shadow-lg"
                >
                  <a href="#" className="block px-4 py-2 hover:bg-[#23252a] rounded-t-lg">Downtown Location</a>
                  <a href="#" className="block px-4 py-2 hover:bg-[#23252a]">Uptown Location</a>
                  <a href="#" className="block px-4 py-2 hover:bg-[#23252a] rounded-b-lg">Westside Location</a>
                </div>
              )}
            </div>
            <button 
              onClick={openTeamModal}
              className="flex items-center bg-[#1e2024] hover:bg-[#23252a] px-4 py-2 rounded-lg transition"
            >
              <i className="fas fa-users mr-2 text-green-400"></i>
              <span>
                Team <span className="bg-blue-500 text-white px-2 py-1 rounded-full text-xs ml-1">{employees.length}</span>
              </span>
            </button>
            <button 
              onClick={onAddEmployee}
              className="flex items-center bg-blue-600 hover:bg-blue-500 px-4 py-2 rounded-lg transition"
            >
              <i className="fas fa-plus mr-2"></i>
              <span>Add Employee</span>
            </button>
          </div>
        </div>
      </header>

      {/* Calendar Navigation */}
      <div className="container mx-auto px-6 py-4">
        <div className="flex justify-between items-center mb-6">
          <button className="flex items-center bg-gray-700 hover:bg-gray-600 px-4 py-2 rounded-lg transition">
            <i className="fas fa-chevron-left mr-2"></i>
            Previous Week
          </button>
          <h2 className="text-xl font-semibold">June 11 - June 17, 2023</h2>
          <button className="flex items-center bg-gray-700 hover:bg-gray-600 px-4 py-2 rounded-lg transition">
            Next Week
            <i className="fas fa-chevron-right ml-2"></i>
          </button>
        </div>

        {/* Calendar Grid */}
        <div className="bg-gray-800 rounded-xl shadow-lg overflow-hidden mb-8">
          <div className="grid grid-cols-7 gap-px bg-gray-700">
            {/* Day Headers */}
            {["Sunday", "Monday", "Tuesday", "Wednesday", "Thursday", "Friday", "Saturday"].map((day, index) => (
              <div key={index} className="bg-gray-800 p-3 text-center font-medium">
                {day}
              </div>
            ))}
            {/* Day Cells with hard-coded shift cards */}
            <div className="bg-gray-800 p-3 drop-zone min-h-40" data-day="sunday"
              onDragOver={handleDragOver}
              onDragLeave={handleDragLeave}
              onDrop={handleDrop}
            >
              <div className="shift-card pastel-blue p-2 mb-2 rounded-lg cursor-move draggable" draggable="true"
                data-id="shift1"
                onDragStart={handleDragStart}
                onDragEnd={handleDragEnd}
              >
                <div className="font-medium">John D.</div>
                <div className="text-xs">8:00 AM - 4:00 PM</div>
              </div>
            </div>
            <div className="bg-gray-800 p-3 drop-zone min-h-40" data-day="monday"
              onDragOver={handleDragOver}
              onDragLeave={handleDragLeave}
              onDrop={handleDrop}
            >
              <div className="shift-card pastel-green p-2 mb-2 rounded-lg cursor-move draggable" draggable="true"
                data-id="shift2"
                onDragStart={handleDragStart}
                onDragEnd={handleDragEnd}
              >
                <div className="font-medium">Sarah M.</div>
                <div className="text-xs">9:00 AM - 5:00 PM</div>
              </div>
              <div className="shift-card pastel-pink p-2 mb-2 rounded-lg cursor-move draggable" draggable="true"
                data-id="shift3"
                onDragStart={handleDragStart}
                onDragEnd={handleDragEnd}
              >
                <div className="font-medium">Mike T.</div>
                <div className="text-xs">12:00 PM - 8:00 PM</div>
              </div>
            </div>
            <div className="bg-gray-800 p-3 drop-zone min-h-40" data-day="tuesday"
              onDragOver={handleDragOver}
              onDragLeave={handleDragLeave}
              onDrop={handleDrop}
            >
              <div className="shift-card pastel-purple p-2 mb-2 rounded-lg cursor-move draggable" draggable="true"
                data-id="shift4"
                onDragStart={handleDragStart}
                onDragEnd={handleDragEnd}
              >
                <div className="font-medium">Emma L.</div>
                <div className="text-xs">10:00 AM - 6:00 PM</div>
              </div>
            </div>
            <div className="bg-gray-800 p-3 drop-zone min-h-40" data-day="wednesday"
              onDragOver={handleDragOver}
              onDragLeave={handleDragLeave}
              onDrop={handleDrop}
            >
              <div className="shift-card pastel-yellow p-2 mb-2 rounded-lg cursor-move draggable" draggable="true"
                data-id="shift5"
                onDragStart={handleDragStart}
                onDragEnd={handleDragEnd}
              >
                <div className="font-medium">Alex K.</div>
                <div className="text-xs">7:00 AM - 3:00 PM</div>
              </div>
            </div>
            <div className="bg-gray-800 p-3 drop-zone min-h-40" data-day="thursday"
              onDragOver={handleDragOver}
              onDragLeave={handleDragLeave}
              onDrop={handleDrop}
            >
              <div className="shift-card pastel-blue p-2 mb-2 rounded-lg cursor-move draggable" draggable="true"
                data-id="shift6"
                onDragStart={handleDragStart}
                onDragEnd={handleDragEnd}
              >
                <div className="font-medium">John D.</div>
                <div className="text-xs">8:00 AM - 4:00 PM</div>
              </div>
            </div>
            <div className="bg-gray-800 p-3 drop-zone min-h-40" data-day="friday"
              onDragOver={handleDragOver}
              onDragLeave={handleDragLeave}
              onDrop={handleDrop}
            >
              <div className="shift-card pastel-green p-2 mb-2 rounded-lg cursor-move draggable" draggable="true"
                data-id="shift7"
                onDragStart={handleDragStart}
                onDragEnd={handleDragEnd}
              >
                <div className="font-medium">Sarah M.</div>
                <div className="text-xs">9:00 AM - 5:00 PM</div>
              </div>
            </div>
            <div className="bg-gray-800 p-3 drop-zone min-h-40" data-day="saturday"
              onDragOver={handleDragOver}
              onDragLeave={handleDragLeave}
              onDrop={handleDrop}
            >
              <div className="shift-card pastel-pink p-2 mb-2 rounded-lg cursor-move draggable" draggable="true"
                data-id="shift8"
                onDragStart={handleDragStart}
                onDragEnd={handleDragEnd}
              >
                <div className="font-medium">Mike T.</div>
                <div className="text-xs">12:00 PM - 8:00 PM</div>
              </div>
              <div className="shift-card pastel-purple p-2 mb-2 rounded-lg cursor-move draggable" draggable="true"
                data-id="shift9"
                onDragStart={handleDragStart}
                onDragEnd={handleDragEnd}
              >
                <div className="font-medium">Emma L.</div>
                <div className="text-xs">10:00 AM - 6:00 PM</div>
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Team Members Modal */}
      {showTeamModal && (
        <div 
          className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50 transition opacity-100"
          onClick={closeTeamModal}
        >
          <div 
            ref={teamModalRef}
            className="bg-[#16181a] rounded-lg shadow-xl w-full max-w-4xl p-6 mx-4 max-h-[90vh] overflow-y-auto"
            onClick={(e) => e.stopPropagation()}
          >
            <div className="flex justify-between items-center mb-6">
              <h3 className="text-2xl font-bold">Team Members ({employees.length})</h3>
              <button onClick={closeTeamModal} className="text-gray-400 hover:text-white">
                <i className="fas fa-times"></i>
              </button>
            </div>
            {/* Team member cards */}
            <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-4 mb-6">
              {employees.map(employee => (
                <div key={employee.id} className="team-member-card bg-[#1d1f23] rounded-lg p-4 shadow hover:shadow-lg transition cursor-pointer">
                  <div className="flex items-center mb-3">
                    <div className="w-10 h-10 rounded-full bg-blue-500 flex items-center justify-center text-white font-medium mr-3">
                      {employee.name.split(' ').map(n => n[0]).join('')}
                    </div>
                    <div className="flex-1">
                      <div className="font-medium">{employee.name}</div>
                      <div className="text-sm text-gray-400">{employee.role}</div>
                    </div>
                    <button 
                      onClick={() => onEditEmployee(employee)} 
                      className="edit-employee-btn bg-blue-600 hover:bg-blue-500 text-white px-3 py-1 rounded-md text-sm transition"
                    >
                      Edit
                    </button>
                  </div>
                  <div className="flex justify-between text-xs">
                    <span className="bg-blue-900 bg-opacity-50 px-2 py-1 rounded">{employee.availability}</span>
                  </div>
                </div>
              ))}
            </div>
            <div className="flex justify-end">
              <button onClick={onAddEmployee} className="flex items-center bg-blue-600 hover:bg-blue-500 px-4 py-2 rounded-lg transition">
                <i className="fas fa-plus mr-2"></i>
                <span>Add Employee</span>
              </button>
            </div>
          </div>
        </div>
      )}

      {/* Add Employee Modal */}
      {showAddEmployeeModal && (
        <div 
          id="addEmployeeModal" 
          className="modal fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50 transition opacity-100"
          onClick={closeAddEmployeeModal}
        >
          <div 
            ref={addEmployeeModalRef}
            className="bg-gray-800 rounded-lg shadow-xl w-full max-w-md p-6 mx-4"
            onClick={(e) => e.stopPropagation()}
          >
            <div className="flex justify-between items-center mb-4">
              <h3 className="text-xl font-bold">Add New Employee</h3>
              <button onClick={closeAddEmployeeModal} className="text-gray-400 hover:text-white">
                <i className="fas fa-times"></i>
              </button>
            </div>
            <form id="addEmployeeForm" onSubmit={(e) => { e.preventDefault(); alert('Employee added successfully!'); closeAddEmployeeModal(); closeTeamModal(); }}>
              <div className="mb-4">
                <label className="block text-gray-300 mb-2">Full Name</label>
                <input type="text" className="w-full bg-gray-700 border border-gray-600 rounded-lg px-4 py-2 focus:outline-none focus:ring-2 focus:ring-blue-500" required />
              </div>
              <div className="mb-4">
                <label className="block text-gray-300 mb-2">Email</label>
                <input type="email" className="w-full bg-gray-700 border border-gray-600 rounded-lg px-4 py-2 focus:outline-none focus:ring-2 focus:ring-blue-500" required />
              </div>
              <div className="mb-4">
                <label className="block text-gray-300 mb-2">Position</label>
                <select className="w-full bg-gray-700 border border-gray-600 rounded-lg px-4 py-2 focus:outline-none focus:ring-2 focus:ring-blue-500" required>
                  <option value="">Select Position</option>
                  <option value="cashier">Cashier</option>
                  <option value="manager">Manager</option>
                  <option value="barista">Barista</option>
                  <option value="cook">Cook</option>
                  <option value="server">Server</option>
                </select>
              </div>
              <div className="mb-6">
                <label className="block text-gray-300 mb-2">Employment Type</label>
                <div className="flex items-center space-x-4">
                  <label className="inline-flex items-center">
                    <input type="radio" name="employmentType" value="full-time" className="text-blue-500" defaultChecked />
                    <span className="ml-2">Full-time</span>
                  </label>
                  <label className="inline-flex items-center">
                    <input type="radio" name="employmentType" value="part-time" className="text-blue-500" />
                    <span className="ml-2">Part-time</span>
                  </label>
                </div>
              </div>
              <div className="flex justify-end space-x-3">
                <button type="button" onClick={closeAddEmployeeModal} className="px-4 py-2 bg-gray-700 hover:bg-gray-600 rounded-lg transition">
                  Cancel
                </button>
                <button type="submit" className="px-4 py-2 bg-blue-600 hover:bg-blue-500 rounded-lg transition">
                  Add Employee
                </button>
              </div>
            </form>
          </div>
        </div>
      )}

      {/* Edit Employee Modal */}
      {showEditEmployeeModal && (
        <div 
          id="editEmployeeModal" 
          className="modal fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50 transition opacity-100"
          onClick={closeEditEmployeeModal}
        >
          <div 
            ref={editEmployeeModalRef}
            className="bg-gray-800 rounded-lg shadow-xl w-full max-w-2xl p-6 mx-4"
            onClick={(e) => e.stopPropagation()}
          >
            <div className="flex justify-between items-center mb-4">
              <h3 className="text-xl font-bold">Edit Employee Schedule</h3>
              <button onClick={closeEditEmployeeModal} className="text-gray-400 hover:text-white">
                <i className="fas fa-times"></i>
              </button>
            </div>
            <div className="flex items-center mb-6">
              <div className="w-12 h-12 rounded-full bg-blue-500 flex items-center justify-center text-white font-medium text-xl mr-4">JD</div>
              <div>
                <div className="font-bold text-lg">John Doe</div>
                <div className="text-gray-400">Manager - Full-time</div>
              </div>
            </div>
            <div className="mb-6">
              <h4 className="font-medium mb-3">Current Schedule</h4>
              <div className="grid grid-cols-7 gap-1 bg-gray-700 rounded-lg p-1">
                {["Sun", "Mon", "Tue", "Wed", "Thu", "Fri", "Sat"].map((day, i) => (
                  <div key={i} className="bg-gray-800 p-2 text-center text-sm">{day}</div>
                ))}
                {/* Hard-coded schedule cells */}
